import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

class TextWithImageHorizontal extends Component {

  constructor( props )
  {

    super(props);

  }

  render() {

    var { title, description, label, float } = this.props;

    return (
      <div data-text-with-image style={{float: float}}>

        <div data-image></div>
        <div data-text>
          <p data-label>{ label }</p>
          <p data-title> { title }</p>
          <p data-description>{ description }</p>
        </div>

      </div>
    );
  }
}
export default TextWithImageHorizontal;
